import React from "react";
import {Link} from "react-router-dom";
import "../index.css"

const Home = () =>{
    return(
<div className="home ">
    <div className="keimeno-koumpia text-center py-6">
        <h1 className="my-auto" >Welcome message</h1>
        <Link to="/login">
        <button type="button" className="btn btn-primary">log in</button>
        </Link>
        <Link to="/register">
        <button type="button" className="btn btn-primary">Register</button>
        </Link>
    </div>
</div>
    )}

export default Home
